const response = {};
const response1 = [];

async function getPosts() {
  try {
    const response = await fetch("https://jsonplaceholder.typicode.com/posts");

    response1 = await response.json();
  } catch (error) {}
}

getPosts();
response1 = await response.json();
console.log(response1);

function Container() {
  return <div className="main"></div>;
}

export default Container;
